// react
import React from 'react';

// third-party
import { NavLink } from 'react-router-dom';

function NavLinks() {
    const links = [
        { title: "General search", url: '/pages/search' },
        { title: "Sent/Received documents", url: '/pages/orders' },
        { title: "Setings", url: '/options' }
    ];

    const linksList = links.map((item, index) => (
        <li key={index} className="nav-links__item">
            <NavLink exact activeClassName="selected" to={item.url}>{item.title}</NavLink>
        </li>
    ));

    return (
        <ul className="nav-links__list">
            {linksList}

            <NavLink exact to='/pages/search'>
                <span>
                    Error
                </span>
            </NavLink>
        </ul>
    );
}

export default NavLinks;
